Message.create!([
  {title: "Draft 2", body: "<p><em>Married since 2013, Tony and Christina strive to ensure the folks at Luke DogWalker feel like a part of each owner's family. They were both raised with dogs roaming their homes, including: several Boston Terriers, a Pomeranian Poodle, and a Siamese cat for Christina. Plus a sheepdog, a Dachshund, and a special Lab named Lucy for Tony.</em></p><p><br></p><p><em><span class=\"ql-cursor\">Ôªø</span></em><img src=\"data:image/jpeg;base64,\"></p><p><br></p><p>The company began in 2009 with Tony and two dogs. Over the last several years, we've added over 100 clients which are spread out between our 10+ walkers. Each walker cares for the same 8-12 pups every day and, as a result, ends up building a nice bond with them. We take the time to develop a friendly relationship with our human clients as well. We know how important each four-legged family member is to you so we pride ourselves on offering unmatched service and personal care every day.</p><p><br></p>", user_id: 9385, preview: "Married since 2013, Tony and Christina strive to ensure the folks at Luke DogWalker feel like a part of each owner's family. They were both raised with dogs roaming their homes, including: seve"},
  {title: "Testing a new Message", body: "<p>How are you?</p>", user_id: 9390, preview: "How are you?"},
  {title: "Customer Interactions", body: "<p><span style=\"background-color: rgb(230, 0, 0);\">When a customer emails you outside of Support Desk, what do you do?</span></p><p><br></p><p><span style=\"background-color: rgb(255, 255, 0);\">It's</span><span style=\"background-color: rgb(0, 138, 0);\"> a situation that James brought up in his check-in and also one that I run into on a daily basis with enterprise customers emailing my Basecamp email address. It's great to give out my direct email for accounts that I rep but at the same time, those interactions don't make their way into Support Desk. That leaves others on our team trying to piece together a customer's history as best as they can.</span></p><p><br></p><p>There's two methods that I've tried so far but I'm curious if anyone else has a better option.</p><p><br></p><p><strong>1) Separate Support Desk Mailbox</strong></p><p>With BC3 Big customers, I've been forwarding them into a separate mailbox. I stole the idea from Tony with his marketing emails. üòÅ</p><p><br></p><p>Pros - it gets every interaction into Support Desk, which means you can see previous tickets in the customer's history.</p><p><br></p><p>Cons - it's a very manual process since each email has to be forwarded in.</p><p><br></p><p><strong>2) Using the phone notes as a workaround</strong></p><p>When you create a new ticket, you can pick the phone option. That gives you a straight notes section to copy/paste in any emails from the customer or any other notes.</p><p><br></p><p>Pros - it gets things into Support Desk and keeps it in one mailbox.</p><p><br></p><p>Cons - still a pretty manual process.</p><p><br></p><p><strong>Has anyone seen / used a better method?</strong></p>", user_id: 9373, preview: "When a customer emails you outside of Support Desk, what do you do?It's"}
])
